import React, { Component } from 'react';

class Current extends Component {
	render() {
            return (
		<div id="current" class="content-wrapper">
		    <h3>Current Projects, Roles & Teaching</h3>
		    <h4>Committee Membership</h4>
		    <ul>
			<li>AAPS CDT Conference 2022 Organising Committee</li>
			<li>AAPS CDT Social Committee</li>
		    </ul>
		    <h4>Teaching</h4>
		    <ul>
			<li><a>MA10275</a> Data Science for </li>
		    </ul>

		</div>
	    );
  	}
}

export default Current;
